import React from "react";
import { NavLink, Link } from "react-router-dom";
import "./Navpar.css";

import ImgLogo from "../img/logo512.png";

export default function Navpar() {
  return (
    <div>
      <div className="text-slate-50 font-mono md:mx-2 flex justify-start ">
        <NavLink to={"/"}>
          <img src={ImgLogo} alt="Nothin Here" className="w-screen" />
        </NavLink>
      </div>
      <div className=" mb-14 flex flex-col md:flex-row  justify-center">
        <div className="text-slate-50 font-mono md:mx-2">
          <NavLink to={"/"}>HOME</NavLink>
        </div>
        <div className="text-slate-50 font-mono md:mx-2">
          <NavLink to={"/about"}>About</NavLink>
        </div>
        <div className="text-slate-50 font-mono md:mx-2">
          <NavLink to={"/tail"}>TailWindCss</NavLink>
        </div>
      </div>
    </div>
  );
}
